import logo from './logo.svg';
import './App.css';

const myList = (<ul>
  <li>Hey</li>
  <li>there</li>
  <li>mate</li>
</ul>)

function App() {
  return (
    <div className="App">
      <header className="App-header">
        myList;
      </header>
    </div>
  );
}

export default App;
